import React from 'react';
import styled from 'styled-components';
import { SubTitle, Title } from '../auth-info';

const Wrapper = styled.div`
  width: 844px;
  margin: 130px auto 50px;
  font-family: MuseoSansMedium,sans-serif;
`

const InfoTitle = styled(Title)`
  width: 568px;
  height: 64px;
  font-size: 26px;
  color: #001424;
  font-weight: 700;
`
const Advantages = styled.div`
  display: flex;
  justify-content: space-between;
  width: 844px;
  margin-top: 50px;
  margin-bottom: 50px;
  ul {
    width: 380px;
    height: auto;
    color: #001424;
    margin-top: 15px;
    padding: 0;
    list-style: none;
  }
  li {
    font-size: 18px;
    line-height: inherit;
    padding-bottom: 5px;
    padding-top: 5px;
  }
`

export const Info = () => {
  return <Wrapper>
    <InfoTitle>
      Автоматическое заполнение профиля и обогащение его персонализированными данными с согласия клиента *
    </InfoTitle>
    <Advantages>
      <div>
        <SubTitle>Преимущества для клиента:</SubTitle>
        <ul>
          <li>Не заполняйте длинные анкеты, Мобильный ID заполнит за вас</li>
          <li>Управляйте доступом к своим данным</li>
          <li>Экономия времени при заполнении</li>
        </ul>
      </div>
      <div>
        <SubTitle>Для сервиса:</SubTitle>
        <ul>
          <li></li>
          <li></li>
        </ul>
      </div>
    </Advantages>
  </Wrapper>
}
